import React, {component} from 'react';
import Aux from '../../hoc/Aux';

class Layout extends component {
	render() {
		return (
			<Aux>
				<div>top bar</div>
				<div>header: logo, menu, icons</div>
				<div>cover</div>
				<div>best for</div>
				<div>selection 2:4</div>
				<div>coupon</div>
				<div>who we are</div>
				<div>testimonials</div>
				<div>Accordions</div>
				<div>newsletter</div>
				<div>footer</div>
				<main className={classes.Content} >
					{this.props.children}
				</main>
			</Aux>
		)
	}
}
